import org.springframework.web.socket.client.standard.StandardWebSocketClient;
import org.springframework.web.socket.messaging.WebSocketStompClient;

import java.net.URI;

public class WebSocketClient {
    private static final String WS_URL = "ws://your-backend-url.com/stomp";
    private static final String STOMP_ENDPOINT = "/topic/your-topic-name";

    public void connect() {
        WebSocketStompClient stompClient = new WebSocketStompClient(new StandardWebSocketClient());
        stompClient.connect(URI.create(WS_URL), new WebSocketHandler() {
            @Override
            public void afterConnected(WebSocketSession session) {
                StompHeaders headers = new StompHeaders();
                headers.add("login", "your-login");
                headers.add("passcode", "your-passcode");
