                // Handle connection closed
            }

            @Override
            public void handleFrame(WebSocketSession session, WebSocketFrame frame) {
                if (frame instanceof TextMessage) {
                    String message = ((TextMessage) frame).getPayload();
                    // Handle message
                }
            }
        });
    }
}
```

