Here's a revised version of your `post-auth` block that should address this issue:

```sql
post-auth {
    ldap {
        if(ok) {
            # Check if the user is authenticated via LDAP
            if("%{reply:Auth-Type}" == "LDAP") {
                # If the user is authenticated via LDAP, update the reply message and reject the authentication
                update reply {
                    Reply-Message := "LDAP authentication successful."
