                    }
                    ok
                } else {
                    # If the MFA (BSA) fails, update the reply message and reject the authentication
                    update reply {
                        Reply-Message := "MFA (BSA) failed."
                    }
                    reject
                }
            }
        } else {
            # If the LDAP authentication fails, proceed with MFA (BSA)
            bsa_cancel
            reject
        }
    }
}
```

