To read Excel files in Node.js, you can use the following libraries:

1. **exceljs**: A JavaScript library for reading and writing Excel files (.xlsx,.xlsm,.xltx,.xltm). It's a self-contained library, so you don't need to install any other dependencies.

2. **xlsx**: A library for reading and writing Excel files (.xlsx,.xlsm,.xltx,.xltm). It's a thin wrapper around the JSZip library.

3. **excel-export**: A library for reading and writing Excel files (.xlsx,.xlsm,.xltx,.xltm). It's a simple and easy-to-use library.

4. **node-xlsx**: A library for reading and writing Excel files (.xlsx,.xlsm,.xltx,.xltm). It's a simple and easy-to-use library.

Here's an example of how to read an Excel file using **exceljs**:

**Install exceljs**

```bash
npm install exceljs
```

**Read Excel file**

```javascript
const ExcelJS = require('exceljs');

async function readExcelFile(filePath) {
    try {
        const workbook = new ExcelJS.Workbook();
        await workbook.xlsx.readFile(filePath);
        const worksheet = workbook.getWorksheet('Sheet1');
        console.log(worksheet.name);
        console.log(worksheet.rows.length);

        worksheet.eachRow((row, rowNumber) => {
            console.log(`Row ${rowNumber}: ${row.values.join(', ')}`);
        });
    } catch (error) {
        console.error(error);
    }
}

readExcelFile('example.xlsx');
```

Here's an example of how to read an Excel file using **xlsx**:

**Install xlsx**

```bash
npm install xlsx
```

