    try {
        const workbook = xlsx.readFile(filePath);
        const worksheet = workbook.Sheets['Sheet1'];
        console.log(worksheet.name);
        console.log(worksheet['!rows'].length);

        worksheet['!rows'].forEach((row, rowNumber) => {
            console.log(`Row ${rowNumber}: ${row.map((cell) => cell.v).join(', ')}`);
        });
    } catch (error) {
        console.error(error);
    }
}

readExcelFile('example.xlsx');
```

