To create a WordPress comment post API with authentication in Next.js, you'll need to follow these steps:

**Step 1: Set up WordPress API**

First, you need to set up the WordPress API to allow comments to be posted. You can do this by:

* Enabling the REST API in WordPress by going to `Settings` > `REST API`
* Creating a new endpoint for comments by adding the following code to your `functions.php` file:
```php
function register_comment_endpoint() {
    register_rest_endpoint('wp/v2', 'comments', array(
       'methods' => 'POST',
        'callback' => 'wp_insert_comment',
        'permission_callback' => '__return_true',
    ));
}
add_action('rest_api_init','register_comment_endpoint');
```
**Step 2: Set up authentication in WordPress**

To authenticate the API requests, you'll need to use a library like `JWT Auth` or `WP-API Authentication`. Here, we'll use `JWT Auth`.

* Install the `jwt-auth` plugin in WordPress
* Create a new secret key in the `wp-config.php` file:
```php
define('JWT_AUTH_SECRET_KEY', 'your-secret-key');
```
**Step 3: Set up authentication in Next.js**

In Next.js, you'll need to use a library like `next-auth` to handle authentication.

* Install `next-auth` by running `npm install next-auth`
* Create a new file called `pages/api/auth/[...nextauth].js` with the following code:
```js
import NextAuth from 'next-auth';
import Providers from 'next-auth/providers';

export default NextAuth({
  providers: [
    Providers.Credentials({
      name: 'WordPress',
      credentials: {
        username: { label: 'Username', type: 'text' },
        password: { label: 'Password', type: 'password' },
      },
      async authorize(credentials) {
        const response = await fetch('https://your-wordpress-site.com/wp-json/jwt-auth/v1/token', {
          method: 'POST',
          body: JSON.stringify({ username: credentials.username, password: credentials.password }),
          headers: { 'Content-Type': 'application/json' },
        });
        const token = await response.json();
        if (token) {
          return token;
        } else {
          return null;
        }
      },
    }),
  ],
  database: process.env.DATABASE_URL,
  secret: process.env.JWT_SECRET,
});
```
**Step 4: Create the comment post API**

Now that you have authentication set up, you can create the comment post API.

* Create a new file called `pages/api/comments.js` with the following code:
```js
import axios from 'axios';

export default async function handler(req, res) {
  const { token } = req.headers;
  if (!token) {
    return res.status(401).json({ error: 'Unauthorized' });
  }

  const comment = req.body;
  const response = await axios.post('https://your-wordpress-site.com/wp-json/wp/v2/comments', comment, {
    headers: {
      'Authorization': `Bearer ${token}`,
      'Content-Type': 'application/json',
    },
  });

  return res.json(response.data);
}
```
This API endpoint expects a `token` header with the authenticated token, and a `comment` body with the comment data.

