Here's an example of how to implement an iframe in Next.js 13 server-side.

**1. Create a new page**

Create a new page in the `pages` directory, e.g., `pages/embed.js`. This page will contain the iframe.

```jsx
// pages/embed.js
import Head from 'next/head';

const EmbedPage = () => {
  return (
    <>
      <Head>
        <title>Embedded Page</title>
      </Head>
      <iframe
        src="https://example.com"
        title="Embedded Page"
        frameBorder="0"
        width="100%"
        height="500"
      />
    </>
  );
};

export default EmbedPage;
```

**2. Add a server-side rendered route**

In Next.js 13, you can create a server-side rendered route using the `use client` directive. However, for an iframe, you can simply use a server-side rendered page. In this case, we'll use the `EmbedPage` component.

Create a new file `src/server/router.js` and add the following code:

```javascript
// src/server/router.js
import { createRouter } from 'next/router';
import { NextPage } from 'next';

const router = createRouter();

router.get('/embed', async () => {
  return {
    props: {
      page: EmbedPage,
    },
  };
});

export default router;
```

**3. Configure the Next.js configuration**

In the `next.config.js` file, add the following code to configure the Next.js router:

```javascript
// next.config.js
module.exports = {
  //... other configurations...
  router: {
    async rewrites() {
      return [
        {
          source: '/embed',
          destination: '/embed',
        },
      ];
    },
  },
};
```

**4. Run the application**

Start the Next.js development server using the following command:

```bash
npm run dev
```

**5. Test the iframe**

Open your web browser and navigate to `http://localhost:3000/embed`. You should see the iframe rendered on the page.

Note: Make sure to replace `https://example.com` with the actual URL you want to embed.

That's it! You have successfully implemented an iframe in Next.js 13 server-side.
